import { fromJS } from 'immutable';
import * as constants from './constants';

const defaultState=fromJS({
    showAvatar:false,
    CarDemo:false
})
export default (state=defaultState,action)=>{
    switch(action.type){
        case constants.UPCARDEMO:
            return state.set('CarDemo',!state.CarDemo)
        default:
            return state;
    }
}
